import React from 'react';
import Menu from './components/Menu'; 
import Tag from './components/Tag';
import './App.css'; 

const App = () => {
    return (
        <div>
            <Menu />
            <div class = "main">
                <h1> Join the Conversation </h1>
                <div class = "tags">
                    <Tag label="Spotify" currColor="#1ED760"/>
                    <Tag label="Apple Music" currColor="#f94c57"/>
                    <Tag label="Tidal" currColor="#0ec2c2" />
                    <Tag label="Pandora" currColor="#e0c0e1"/>
                    <Tag label="Comparisons" currColor="#f94c57"/>
                    <Tag label="Features" currColor='black'/>
                    <Tag label="Bugs" currColor='grey'/>
                    <Tag label="Discussion" currColor='grey'/>
                </div>


            </div>
        </div>

    );
};

export default App;
